import type { FileData, FileFormat, FormatHandler } from "../FormatHandler.ts";

class batToExeHandler implements FormatHandler {

  public name = "batToExe";
  public supportedFormats = [
    { name: "Windows Batch file",       format: "batch",      extension: "text/bat", mime: "text/windows-batch", from: true,  to: false, internal: "bat" },
    { name: "Windows 64bit Executable", format: "executable", extension: "exe",      mime: "binary/exe-win64",   from: false, to: true,  internal: "exe" }
  ];
  public ready = false;

  async init() {
    this.ready = true;
  }

  async doConvert(
    inputFiles: FileData[],
    inputFormat: FileFormat,
    outputFormat: FileFormat
  ): Promise<FileData[]> {

    // This is a EXE file with a buffer of 65824 bytes (space by defult). It writes the buffer as a .bat file an executes it, then deletes it.
    // This can be improved futher by having paches for this exe for difrent lenghts of data.
    // But the correct way is to do a better paching where we patch the hash, data lenght and the data itself, but this is a quick and dirty way to do it.
    const data = base64ToUint8Array("");
    const outputFiles: FileData[] = [];

    for (const file of inputFiles) {
      
      let out = new Uint8Array(data);

      if (inputFormat.internal === "bat" && outputFormat.internal === "exe") {
        if (file.bytes.length >= 65824-6) throw "Input too long. Max 65818 bytes.";
        out.set(file.bytes, 0x22CE0); // writes file as bytes.
        out.set([0x0D,0x0A,0x65,0x78,0x69,0x74], 0x22CE0 + file.bytes.length); // exit batch script
      } else {
        throw "Invalid output format.";
      }

      const outputName = file.name.split(".").slice(0, -1).join(".") + "." + outputFormat.extension;

      outputFiles.push({
        name: outputName,
        bytes: out
      });
    }

    return outputFiles;
  }

}

function base64ToUint8Array(base64: string): Uint8Array {
  const binary = atob(base64); // decode Base64 to string
  const len = binary.length;
  const bytes = new Uint8Array(len);
  for (let i = 0; i < len; i++) {
    bytes[i] = binary.charCodeAt(i);
  }
  return bytes;
}

export default batToExeHandler;
